--
-- Definition of procedure `Gem_Plan_Insert_p`
--

DROP PROCEDURE IF EXISTS `Gem_Plan_Insert_p`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `Gem_Plan_Insert_p`(I_title varchar(400),
                               I_Gem_Model_Bom_Id varchar(400),
                               I_Sys_Organization_Id varchar(400),
                               I_Zj_User_Ids varchar(400), 
                               I_Zj_User_Names varchar(400),
                               I_Gem_Plan_Head_Id varchar(400),
                               I_Type varchar(400),
                               I_Login_User_Organization_Id varchar(400),
                               OUT O_Return_in int,
                               OUT O_Return_String varchar(400))
local_proc:BEGIN 
  
  DECLARE v_id  VARCHAR(32);
  DECLARE v_name varchar(200) CHARACTER SET utf8; 
  DECLARE v_code varchar(200);
  DECLARE v_value decimal(10,6);
  DECLARE v_seq int;
  DECLARE v_pid varchar(32);
  DECLARE v_nlevel int;
  DECLARE V_Gem_Plan_Id      VARCHAR(32);
  DECLARE V_Temp_Parent_Id   VARCHAR(32);
  DECLARE V_Gem_Plan_List_Id VARCHAR(32);
  DECLARE V_Temp_Zj_Ids      VARCHAR(4000);
  DECLARE V_Sys_User_Id      VARCHAR(32);
  DECLARE V_Count_Node       int;
  DECLARE done INT DEFAULT FALSE;
  DECLARE cur_bom CURSOR FOR
 
  SELECT
    T.id,
    T.NAME,
    T.code,
    t.value,
    T.seq,
    T.pid,
    t.nlevel
  FROM Gem_Model_Bom t
  WHERE INSTR(t.tree_index, CONCAT('@', I_Gem_Model_Bom_Id, '@')) > 0;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
     
    set V_Gem_Plan_Id = Sys_Guid();
       Title,
       Gem_Model_Bom_Id,
       Zj_User_Ids,
       Zj_User_Names,
       Sys_Organization_Id,
       Gem_Plan_Head_Id,
       TYPE,
       Login_User_Organization_Id)
    VALUES
      (V_Gem_Plan_Id,
       I_Title,
       I_Gem_Model_Bom_Id,
       I_Zj_User_Ids,
       I_Zj_User_Names,
       I_Sys_Organization_Id,
       I_Gem_Plan_Head_Id,
       I_Type,
       I_Login_User_Organization_Id);

  set V_Temp_Zj_Ids = I_Zj_User_Ids;

  OPEN cur_bom;
    cur_loop:loop 
      FETCH cur_bom INTO v_id,v_name,v_code,v_value,v_seq,v_pid,v_nlevel;
      if done then 
        leave cur_loop;
      end if;
      
      set V_Gem_Plan_List_Id = Sys_Guid();
         Gem_Plan_Id,
         Gem_Model_Bom_Id,
         NAME,
         Code,
         VALUE,
         Pid,
         Seq,
         nlevel,
         Status)
      VALUES
        (V_Gem_Plan_List_Id,
         V_Gem_Plan_Id,
         v_Id,
         v_Name,
         v_Code,
         v_Value,
         case when v_nlevel='1' then '' else v_pid end,
         v_Seq,
         v_nlevel,
         '0');
    
    WHILE INSTR(V_Temp_Zj_Ids,';')>0 do
       set V_Sys_User_Id = Substr(V_Temp_Zj_Ids,
                                  1,
                                  Instr(V_Temp_Zj_Ids, ';') - 1);
       set V_Temp_Zj_Ids = Substr(V_Temp_Zj_Ids,
                                  Instr(V_Temp_Zj_Ids, ';') + 1);
     END while;
    end loop;    
  close cur_bom; 
  SET O_Return_in = 0;
  SET O_Return_String = V_Gem_Plan_Id;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `getNode_model_bom_p`
--

DROP PROCEDURE IF EXISTS `getNode_model_bom_p`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getNode_model_bom_p`()
BEGIN
  
  DECLARE Level int;
  SET Level = 0;
  UPDATE gem_model_bom a
  INNER JOIN (SELECT id,Level,CONCAT(id) tree_index FROM gem_model_bom WHERE pid IS NULL) b
  ON a.id = b.id
  SET a.nlevel = b.Level,
      a.tree_index = CONCAT(b.tree_index);
  WHILE FOUND_ROWS() > 0 DO
    SET Level = Level + 1;
    UPDATE gem_model_bom a
    INNER JOIN (SELECT id,Level,tree_index FROM gem_model_bom WHERE nlevel = Level - 1) b
    ON a.pid = b.id
    SET a.nlevel = b.Level,a.tree_index = CONCAT(b.tree_index,'@',a.id);
  END WHILE;
  UPDATE gem_model_bom a 
    set a.tree_index = CONCAT(a.tree_index,'@');
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

